script: |
  super -f text -I q1375.spq | sort > q1375.out

inputs:
  - name: q1375.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE col0 * + 92 NOT BETWEEN ( ( - col1 ) * - col2 ) AND + col2;
  - name: tab1

outputs:
  - name: q1375.out
    data: |
      51	14	96
      85	5	59
      91	47	68
